import React from 'react';
import '../styles.css';

const cardNames = [
  "Total de Fretes",
  "Meta Mensal",
  "Dias sem Lançamento",
  "Contratado no Prazo",
  "Tempo Médio de Contratação",
  "Total Ocorrência no Mês",
  "Ocorrências Resolvidas no Prazo",
  "Tempo Médio de Resolução",
  "Transportadores Engajados",
  "Transp. Ativos",
  "Total de Canhotos",
  "Aprovados no Prazo",
  "Tempo Médio de Aprovação",
  "Fretes Rastreado",
  "Entregas no Prazo",
  "Coletas no Prazo"
];

function App() {
  return (
    <div className="container">
      {cardNames.map((name, index) => (
        <div className="card" key={index}>
          <h3>{name}</h3>
          <p>Conteúdo do card {index + 1}</p>
        </div>
      ))}
      <div className="pie-chart">
        {/* Adicione o componente do gráfico de pizza aqui */}
        <h3>Saúde Total</h3>
      </div>
    </div>
  );
}

export default App;
